import React from "react";

const style = {
    box: {
        width: '152px',
        height: '215px'
    },
    img: {
        width: '152px',
        height: '215px'
    }
}

function ViewMainList(props) {

    return (
        <div className={'container my-5'}>
            <div className={'row'}>
                <div className={'col-sm-auto'} style={style.box}>
                    <img src={'/image/1.png'} style={style.img} />
                </div>
                <div className={'col-sm'} id={''}>
                    <div id={''}>
                        <a href={'#'} className={'text-lg'} onClick={''}>Title</a>
                        <span className={'text-sm'}>subTitle</span>
                    </div>
                </div>
                <div className={'col-sm'}>
                    <button type={'button'} className={'btn text-center'} name={''}>중고도서보기</button>
                    <br/>
                    <button type={'button'} className={'btn text-center'} name={''}>중고도서판매하기</button>
                </div>
            </div>
        </div>
    )
}

export default ViewMainList;
